    function myposition(ele, iframe){
        var p = ele.getBoundingClientRect();
        var width = document.documentElement.clientWidth;
        var height = document.documentElement.clientHeight;
        var topBottom = function() { return ((height-p.bottom) < 400 && p.top > 400); };
        var left = p.left;
        var right = p.right;
        var top = p.top;
        var bottom = p.bottom;
        console.log("This is bounding rectangle posiition is=left:"+ left,"top:"+top);
        console.log("The element is scrollded="+ele.parentNode.parentNode.parentNode.scrollTop);
        resetFrame(iframe);

        /*dispaly on right*/
        if ((width - p.right) > 510) {
            iframe.style.left = right + 20 + "px";
            if (topBottom(p.top,p.bottom)) {
            		  if(ie) iframe.style.bottom = height-bottom-320 + "px";
                 else iframe.style.bottom = height - bottom -70+ "px"; /*towards the top*/
              
            } else {
                iframe.style.top = top - 50 + "px"; /*towards the bottom*/
            }
            return ("vtc-i-right");
        }

        /*display on the left*/
        if (p.left > 510) {
            iframe.style.right = width - left + 20 + "px";
            if(topBottom(p.top, p.bottom)) {
            	if(ie) iframe.style.bottom = height - bottom-320 + "px";
              else  iframe.style.bottom = height - bottom - 70 + "px";
            } else {
                iframe.style.top = top - 50 + "px";
            }
            return("vtc-i-left");
        }

        /*display on the bottom*/
        if (p.left < (width/2)) {
            iframe.style.top = bottom + 23 + "px";
            if (p.left < (width/4)) {
                iframe.style.left = left - 30 + "px";
            } else {
                iframe.style.left = left - 150 + "px";
            }
            return "vtc-i-bottom";
        }

        /*default bottom*/
        iframe.style.top = bottom + 23 + "px";
        if ((width-p.right) < (width/4)) {
            iframe.style.right = width - right-30 + "px";
        } else {
            iframe.style.left = left - 150 + "px";
        }
        return "vtc-i-bottom";
    }

